    id: "e3",
    title: "Car Insurance",
    amount: 294.67,
    date: new Date(2021, 2, 28),
  },
  {
    id: "e4",
    title: "New Desk (Wooden)",
    amount: 450,
    date: new Date(2021, 5, 12),
  },
];


function App() {
  function getData(value){
    console.log(value);
  }


  return (
    <div>
      <AddExpense takeData={getData}/>
      <div>
        <NewExpense data={expenses}/>
      </div>
    </div>
  );
}

export default App;
